import yfinance as yf

def get_target_price(symbol):
    # Fetch the stock information
    stock = yf.Ticker(symbol)

    # Fetch the latest stock price
    stock_info = stock.info
    latest_price = stock_info.get('currentPrice')

    # Fetch the target mean and median prices
    target_mean_price = stock_info.get('targetMeanPrice')
    target_median_price = stock_info.get('targetMedianPrice')
    target_high_price = stock_info.get('targetHighPrice')



    # Check if all the required information is available
    if latest_price is None:
        raise ValueError("Failed to retrieve stock information.")

    # Calculate the difference between the latest price and the target prices
    if latest_price and target_mean_price and target_median_price:
        mean_price_diff = target_mean_price - latest_price
        median_price_diff = target_median_price - latest_price
        high_price_diff = target_high_price - latest_price
        return latest_price, target_mean_price, target_median_price, mean_price_diff, median_price_diff, high_price_diff
    else:
        return None

