import pandas as pd
import yfinance as yf


def get_target_price(symbol):
    # Fetch the stock information
    print("Symbol: ", symbol)
    try:
      stock = yf.Ticker(symbol)
    except:
      return None

    # Fetch the latest stock price
    try:

      stock_info = stock.info
      print(stock_info)
      latest_price = stock_info.get('currentPrice')

    except:
      return None
    # Fetch the target mean and median prices
    target_mean_price = stock_info.get('targetMeanPrice')
    target_median_price = stock_info.get('targetMedianPrice')
    target_high_price = stock_info.get('targetHighPrice')
    recommendation = stock_info.get('recommendationKey')
    overall_risk = stock_info.get('overallRisk')



    # Check if all the required information is available
    if latest_price is None:
        print(stock_info)
        latest_price = stock_info.get('previousClose')
        #raise ValueError("Failed to retrieve stock information.")

    # Calculate the difference between the latest price and the target prices
    if latest_price and target_mean_price and target_median_price:
        mean_price_diff = target_mean_price - latest_price
        median_price_diff = target_median_price - latest_price
        high_price_diff = target_high_price - latest_price
        return latest_price, target_mean_price, target_median_price, target_high_price, mean_price_diff, median_price_diff, high_price_diff, recommendation, overall_risk
    else:
        return None



def get_target_prices_for_symbols(symbols):
    results = []
    for symbol in symbols:
        target_price_data = get_target_price(symbol)
        if target_price_data:
            results.append([symbol] + list(target_price_data))
    df = pd.DataFrame(results, columns=['Symbol', 'Latest Price', 'Target Mean Price', 'Target Median Price', 'Target High Price',
                                        'Mean Price Difference', 'Median Price Difference', 'High Price Difference', 'Recommendation', 'Risk'])
    return df

