import pandas as pd



def merge_header_rows_and_convert_row2_to_string(excel_file_path, sheet_name='Sheet1'):
    # Load the sheet
    #df = pd.read_excel(excel_file_path, sheet_name=sheet_name)

    # Convert the entire second row to string format
    row_2_as_string = df.iloc[1].astype(str)

    # Retrieve the first row for header transformation
    header_row_1 = df.iloc[0]

    # Construct new column names based on the first row and the converted second row
    new_columns = []
    for i, col in enumerate(df.columns):
        if i < 2:  # First three columns remain unchanged
            new_columns.append(col)
        else:
            # Use the converted string from the second row for the new column name
            new_column_name = f"{header_row_1[i]}-{row_2_as_string[i]}" if pd.notnull(header_row_1[i]) else col
            new_columns.append(new_column_name)

    # Update dataframe with new, corrected column names
    df.columns = new_columns

    # Drop the first two rows as they are now part of the column names
    transformed_df = df.drop(index=[0, 1])

    # Reset index after dropping rows
    transformed_df.reset_index(drop=True, inplace=True)

    return transformed_df

