    new_columns = ['Symbol', 'Symbol.1', 'Decision', 'Decision_Buy_Sell_Score', 'Reasoning']
    ratio_columns_data = {}

    for i in range(5, len(df.columns), 2):  # Starting from column index 5 to skip non-Call/Put columns
        call_column_name = f"Call-{call_put_counter}"
        put_column_name = f"Put-{call_put_counter}"
        ratio_column_name = f"Call-{call_put_counter}/Put-{call_put_counter}"

        # Rename columns
        df.rename(columns={df.columns[i]: call_column_name, df.columns[i+1]: put_column_name}, inplace=True)
        new_columns.extend([call_column_name, put_column_name, ratio_column_name])

        # Calculate ratio and store in a temporary dictionary
        call_values = df[call_column_name].replace('', np.nan).astype(float)
        put_values = df[put_column_name].replace('', np.nan).astype(float)
        ratio_values = call_values / put_values
        ratio_columns_data[ratio_column_name] = ratio_values

        call_put_counter += 1

    # Add new ratio columns to the dataframe
    for ratio_column_name, ratio_values in ratio_columns_data.items():
        df[ratio_column_name] = ratio_values

    # Reorder dataframe to include ratio columns at their respective positions
    df = df[new_columns]

    return df

